class SectionHeading extends Component {
    render() {
        return(
            <h1 style={{float: this.props.align, marginBottom: '44px', width: '100%'}}><mark>{'<'}</mark> {this.props.heading} <mark>{'/>'}</mark></h1>
        )
    }
}

export default SectionHeading;
